import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

class Map extends React.Component {
    render(){
        return (
            <div class="map"></div>
        )
    }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Map />);
